import React from 'react';

import Box from '@mui/material/Box';
import Header from '../Header';

function App() {
  return (
    <>
      <Header />
      <Box
        sx={{
          bgcolor: 'primary.dark',
          height: '50vh',
        }}
      />
    </>
  );
}

export default App;
